import {FaShoppingCart} from "react-icons/fa"
import logo from "./Daco_5715743.png"
import { NavLink } from "react-router-dom";
const Navbar = () => {
  return (
    <div>
      <div className="flex flex-row justify-between">
        <NavLink>
          
        </NavLink>
      </div>
      <div>
        <p>Home</p>
        <FaShoppingCart/>
      </div>
    </div>
  )
};

export default Navbar;
